import React from 'react';

const Greeting = () => {
    
    const obtainData = async function(){
        const res = await fetch('https://jsonplaceholder.typicode.com/users');
        let finalRes = await res.json()
        return finalRes
    }

    const Getname = async () => {await obtainData().then(res => res[0].name)}

    const name = Getname()

    return(
        <h1> Hello !{name}</h1>
    )
}

export default Greeting;
